import { useState } from "react";
import UploadFile from "./UploadFile";
import GenerateImage from "./GenerateImage";

const Home = () => {
  const [lyrics, setLyrics] = useState("");
  const [filename, setFilename] = useState("");
  return (
    <div style={outer}>
      <h1>Music To Image</h1>
      <div style={inner}>
        <div>
          <UploadFile changeLyrics={setLyrics} changeFile={setFilename} />
          <h3>{`Filename: ${filename}`}</h3>
          <h3>{`Lyrics:`}</h3>
          <p>{lyrics}</p>
        </div>
        <GenerateImage />
      </div>
    </div>
  );
};

const outer = {
  textAlign: "center",
  margin: "auto",
};

const inner = {
  display: "flex",
  justifyContent: "space-around",
  padding: "50px",
};

export default Home;
